/**
 * One party terminated Agreement. Termination Reason and signature can be retrieved from event.
 *
 */
export type AgreementTerminatedEvent = (({
    eventType: string;
    eventDate: string;
} & {
    agreementId: string;
}) & {
    terminator: 'Requestor' | 'Provider';
    signature: string;
    /**
     * Generic Event reason information structure.
     *
     */
    reason?: Record<string, any>;
});
